import React, { useState } from "react";
import Logo from "../images/logo.png";
import Cover from "../images/cover.png";
import { Nav, Navbar, Button } from "react-bootstrap";
import "./style.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faUserCircle,
  faBars,
  faSearch,
} from "@fortawesome/free-solid-svg-icons";
import Sidebar from "react-sidebar";

export default function Main() {
  const [openSideBar, setOpenSideBar] = useState(false);

  return (
      <Sidebar
        sidebar={<div>Here</div>}
        open={openSideBar}
        onSetOpen={setOpenSideBar}
        styles={{ sidebar: { background: "white" } }}
        pullRight
      >
        <Navbar bg="light" variant="light">
          <Navbar.Brand href="home">
            <img src={Logo} width="200px"></img>
          </Navbar.Brand>
          <Nav className="mr-auto">
            <Nav.Link href="transitionalplanning">
              Transitional Planning
            </Nav.Link>
            <Nav.Link href="alternativepaths">Alternative Paths</Nav.Link>
            <Nav.Link href="community">Community</Nav.Link>
          </Nav>
          <FontAwesomeIcon
            icon={faSearch}
            style={{ fontSize: "2em", margin: "10px" }}
            color="#DEDEDE"
          />
          <FontAwesomeIcon
            icon={faUserCircle}
            style={{ fontSize: "2em", margin: "10px" }}
            color="#DEDEDE"
          />
          <FontAwesomeIcon
            icon={faBars}
            style={{ fontSize: "2em", margin: "10px" }}
            color="#DEDEDE"
            onClick={() => setOpenSideBar(true)}
          />
        </Navbar>
        <img src={Cover} style={{"width": "100%"}}/>
        <Button style={{"color":"1B7B89"}}>Primary</Button>
      </Sidebar>
  );
}
